import React from 'react';
import ReactDOM from 'react-dom';
import add from './Calculate';
import './App.css';

ReactDOM.render(

  <>
   <ul>
     <li>
       the sum of two number is {add(40,4)}
     </li>
     <li>
       the sub of two number is {add(40,4)}
     </li>
     <li>
       the mult of two number is {add(40,4)}
     </li>
     <li>
       the division of two number is {add(40,4)}
     </li>
   </ul>
  </>
  ,
  document.getElementById('root')
);
